// src/components/TerminalWindow.tsx

import React, { useEffect, useRef } from 'react';
import { AnalysisResult } from '../types';
import '../styles/Terminal.css'; // We'll use the (new) terminal CSS

interface TerminalWindowProps {
  analysis: AnalysisResult | null;
}

const TerminalWindow: React.FC<TerminalWindowProps> = ({ analysis }) => {
  const terminalEndRef = useRef<HTMLDivElement>(null);

  // Auto-scroll to the bottom
  useEffect(() => {
    terminalEndRef.current?.scrollIntoView({ behavior: 'smooth' });
  }); // Run on every render to keep it scrolled down

  // Helper to format the score as a percentage
  const formatPercent = (score: number) => {
    return (score * 100).toFixed(1) + '%';
  };

  return (
    <div className="terminal-container">
      {/* Terminal Header Bar */}
      <div className="terminal-header">
        <div className="terminal-buttons">
          <span className="terminal-dot red"></span>
          <span className="terminal-dot yellow"></span>
          <span className="terminal-dot green"></span>
        </div>
        <span>analysis_feed.log</span>
      </div>

      {/* Terminal Body */}
      <div className="terminal-body">
        {/* If no analysis, show a pending message */}
        {!analysis && (
          <div className="terminal-line">
            <span className="terminal-prompt">&gt;</span>
            <span className="terminal-text">
              Analysis pending... (Waiting for 5+ messages)
            </span>
          </div>
        )}

        {/* If we HAVE analysis, print it */}
        {analysis && (
          <>
            {/* 1. Print the Summary */}
            <div className="terminal-line">
              <span className="terminal-prompt">&gt;</span>
              <span className="terminal-text terminal-label">SUMMARY:</span>
            </div>
            <div className="terminal-line">
              <span className="terminal-prompt"> </span>
              <span className="terminal-text">{analysis.summary}</span>
            </div>

            <div className="terminal-line">
              <span className="terminal-prompt">&gt;</span>
              <span className="terminal-text terminal-label">PREDICTIONS:</span>
            </div>

            {/* 2. Print Top Prediction */}
            {analysis.predictions[0] && (
              <div className="terminal-line">
                <span className="terminal-prompt"> </span>
                <span className="terminal-text">
                  most likely: probably:{' '}
                  <strong style={{ color: analysis.predictions[0].color }}>
                    {analysis.predictions[0].label} (
                    {formatPercent(analysis.predictions[0].score)})
                  </strong>
                </span>
              </div>
            )}

            {/* 3. Print Second Prediction */}
            {analysis.predictions[1] && (
              <div className="terminal-line">
                <span className="terminal-prompt"> </span>
                <span className="terminal-text">
                  second most likely: potentially:{' '}
                  <strong style={{ color: analysis.predictions[1].color }}>
                    {analysis.predictions[1].label} (
                    {formatPercent(analysis.predictions[1].score)})
                  </strong>
                </span>
              </div>
            )}
          </>
        )}

        {/* Fake blinking cursor */}
        <div className="terminal-line">
          <span className="terminal-prompt">&gt;</span>
          <span className="terminal-cursor">_</span>
        </div>

        <div ref={terminalEndRef} />
      </div>
    </div>
  );
};

export default TerminalWindow;
